var ParentDeviceName = "Cooler Master ARGB GEN2 Controller";
export function SupportsSubdevices(){ return true; }
const Gen1ChLedLimit = 48;
const Gen2ChLedLimit = 80;
var ChannelArray = [ "Channel 1", "Channel 2", "Channel 3" ]
var savedGenCh1;
var savedGenCh2;
var savedGenCh3;

function SetupChannels(init = false)
{
	var DeviceLedLimit = 0;
	for(let i = 0; i < ChannelArray.length; i++)
	{
		var ChannelGen = i == 0 ? GenCh1 : i == 1 ? GenCh2 : GenCh3;
		var ChMaxLeds = ChannelGen == "GEN1" ? Gen1ChLedLimit : Gen2ChLedLimit;
		if(!init)
		{
			device.removeChannel(ChannelArray[i]);
		}
		device.addChannel(ChannelArray[i], ChMaxLeds);
		DeviceLedLimit += ChMaxLeds;
		var packet = [];
		packet[0] = 0x00;
		packet[1] = 0x80;
		if(ChannelGen == "GEN2")
		{
			for(var Packets = 0; Packets <= 3; Packets++)
			{
				packet[2] = (Packets == 2 ? 0xb2 : Packets == 3 ? 0x07 : 0x0b);
				packet[3] = (Packets == 1 ? 0x02 : Packets == 2 ? 0x02 : 0x01);
				packet[4] = 1 << i;
				device.write(packet,65);
			}
		}
		else
		{
			packet[2] = 0x0b;
			packet[3] = 0x01;
			packet[4] = 1 << i;
			device.write(packet,65);
			
			packet[2] = 0x06;
			device.write(packet,65);
		}
	}
	device.SetLedLimit(DeviceLedLimit);
}

const vKeyNames = [];
const vKeyPositions = [];

export function LedNames()
{
	return vKeyNames;
}

export function LedPositions()
{
	return vKeyPositions;
}

export function Initialize()
{
	sendPacketString("00 80 01 02 01",65);
	sendPacketString("00 00 09 ff ff 90",65);
	sendPacketString("00 01 09",65);
	sendPacketString("00 82 09",65);
	savedGenCh1 = GenCh1;
	savedGenCh2 = GenCh2;
	savedGenCh3 = GenCh3;
	SetupChannels(true);
}

export function Shutdown()
{
	SendChannel(0, true, savedGenCh1 == 'GEN1' ? false : true);
	device.pause(10);
	SendChannel(1, true, savedGenCh2 == 'GEN1' ? false : true);
	device.pause(10);
	SendChannel(2, true, savedGenCh3 == 'GEN1' ? false : true);
	device.pause(10);
}

function SendChannel(Channel,shutdown = false, GEN2 = false)
{
	var ChannelLedCount = device.channel(ChannelArray[Channel]).ledCount;

	var RGBData = []
	if(shutdown)
	{
		RGBData = device.createColorArray(shutdownColor, ChannelLedCount, "Inline");
	}
	else if(LightingMode == "Forced")
	{
		RGBData = device.createColorArray(forcedColor, ChannelLedCount, "Inline");
	}
	else if(device.getLedCount() == 0)
	{
		ChannelLedCount = GEN2 ? Gen2ChLedLimit : Gen1ChLedLimit;
		var pulseColor = device.getChannelPulseColor(ChannelArray[Channel], ChannelLedCount);
		RGBData = device.createColorArray(pulseColor, ChannelLedCount, "Inline");
	}
	else
	{
		RGBData = device.channel(ChannelArray[Channel]).getColors("Inline");
	}
	
	if(!GEN2 || device.getLedCount() == 0)
	{
		for(var Packets = 0; Packets <= 2; Packets++)
		{
			var packet = [];
			packet[0] = 0x00;
			if(Packets == 0)
			{
				packet[1] = 0x00;
				packet[2] = 0x09;
				packet[3] = 1 << Channel;
				packet[4] = 0x00;
				packet[5] = 0x90;
				packet = packet.concat(RGBData.splice(0,59));
			}
			else
			{
				packet[1] = (Packets == 1 ? 0x01 : 0x82);
				packet[2] = 0x09;
				packet = packet.concat(RGBData.splice(0,62));
			}
			device.write(packet,65);
		}
		device.pause(10);
	}
	else
	{
		var components = device.channel(ChannelArray[Channel]).getComponentNames();
		var componentCount = components.length;

		for(var currComp = 0; currComp < componentCount; currComp++)
		{
			var DeviceRGBData = RGBData.splice(0,((device.channel(ChannelArray[Channel]).getComponentData(components[currComp]).LedCount)*3));
			for(var Packets = 0; Packets <= 2; Packets++)
			{
				var packet = [];
				packet[0] = 0x00;
				if(Packets == 0)
				{
					packet[1] = 0x00;
					packet[2] = 0x09;
					packet[3] = 1 << Channel;
					packet[4] = 1 << currComp;
					packet[5] = 0x90;
					packet = packet.concat(DeviceRGBData.splice(0,59));
				}
				else
				{
					packet[1] = (Packets == 1 ? 0x01 : 0x82);
					packet[2] = 0x09;
					packet = packet.concat(DeviceRGBData.splice(0,62));
				}
				device.write(packet,65);
			}
			device.pause(10);
		}
	}
}

export function Render()
{
	if(savedGenCh1 != GenCh1 || savedGenCh2 != GenCh2 || savedGenCh3 != GenCh3)
	{
		savedGenCh1 = GenCh1;
		savedGenCh2 = GenCh2;
		savedGenCh3 = GenCh3;
		SetupChannels();
	}
	SendChannel(0, false, savedGenCh1 == 'GEN1' ? false : true);
	SendChannel(1, false, savedGenCh2 == 'GEN1' ? false : true);
	SendChannel(2, false, savedGenCh3 == 'GEN1' ? false : true);
}

function sendPacketString(string, size)
{
	var packet= [];
	var data = string.split(' ');
	
	for(let i = 0; i < data.length; i++)
	{
		packet[i] = parseInt(data[i],16)
	}
	device.write(packet, size);
}

export function Validate(endpoint)
{
	return endpoint.interface === 1;
}

